import {Container, HeaderChess, ContornoImg, Alpha} from '../style/style'


function Home () {
    return (
        <Alpha>
            <Container >
                <HeaderChess>
                    <ContornoImg src="/chess.webp"/>
                </HeaderChess>
            </Container>
        </Alpha>
        
    )
}

export default Home
